    self, survey_id, user_id, question_ids, filter_data=None,
    compare_data=None, response_limitation=None
):

    params = {
        'survey_id': survey_id,
        'questions': question_ids
    }

    if filter_data is not None:
        params['filter'] = filter_data

    if compare_data is not None:
        params['compare'] = compare_data

    if response_limitation is not None and \
            response_limitation != 'unlimited':
        params['context'] = {
            'response_limitation': response_limitation
        }

    # This helps the backend decache a .NET user when there are filter
    # changes.
    params['user_id'] = user_id

    return self._post(self.QUESTION_ROLLUPS_URL, data=params)

